import React, { useState } from 'react';
import Wall from './Wall';
import WallPosterSelect from './WallPosterSelect';

function App() {
  const [wallConfig, setWallConfig] = useState(null);

  if (!wallConfig) {
    return <WallPosterSelect onContinue={setWallConfig} />;
  }

  return <Wall wallBg={wallConfig.wallBg} wallSize={wallConfig.wallSize} />;
}

export default App;
